$(document).ready(function(){cleanCart();connectCatalog();$(".catalog").each(function(){var b=$(this);$.ajax({type:"POST",url:"/inc/echoCatalog.php",data:{tags:$(this).data("tags")},success:function(c){b.html(c);connectCatalog()}})});$("#Head-searchInput").keyup($.debounce(500,a));function a(){var b=$("#Head-searchInput").val();if(b==""){$("#Search").html("")}else{$.ajax({type:"POST",url:"/inc/search.php",data:{q:b},success:function(c){$("#Search").html(c)}})}}});